import React, { useState } from "react";
import axios from 'axios';
// core components
import ExamplesNavbar from "components/Navbars/ExamplesNavbar.js";
import DarkFooter from "components/Footers/DarkFooter.js";

// reactstrap components
import { Button, Container, Row, Col } from "reactstrap";

function FoodPage() {
  const [names,setNames]=useState([]);

  React.useEffect(() => {
    let isSubscribed = true;
    axios
    .get(
      '/api/getfood'
    )
    .then(Response => {
      
      if (Response.status === 200) {
             
        setNames(Response.data.data);
        //setLengths(Response.data.response.body.items.length);
        //console.log(Response.data.response.body.items.length);
        console.log(Response.data.data);
       // check if this component still mounted
       if (isSubscribed) {
         //setLoading(false);
       }
     }
    });
    //.catch((Error)=>{console.log(Error)});

    document.body.classList.add("food-page");
    document.body.classList.add("sidebar-collapse");
    document.documentElement.classList.remove("nav-open");
    window.scrollTo(0, 0);
    document.body.scrollTop = 0;
    return function cleanup() {
      document.body.classList.remove("food-page");
      document.body.classList.remove("sidebar-collapse");
    };
  }, []);
  const Namelists= names.map((name)=> {
           const searchurl="https://search.daum.net/search??w=tot&&q="+ name.음식테마거리명
           const mapurl="https://map.kakao.com/link/to/,"+name.음식테마거리명+"," +name.latitude+","+name.longitude
           const Travel16="name."+"음식테마거리 소개"
        return(
          <div className="section3 section-nucleo-icons">
    
          <Container>
              <Row>
                 {/* <h5> {name.rdnmadr.split(" ")[0]}</h5>  */}
                <Col lg="6" md="12">
                  <h2 className="title">{name.음식테마거리명} </h2>
                 <h5 className="description">
                    {Travel16}
                  </h5>
                  <Button
                    className="btn-detail"
                    color="info"
                    size="lg"
                    href = {searchurl}
                    target="_blank"
                  > 자세히
                  </Button>
                  <Button
                    className="btn-detail"
                    color="info"
                    href={mapurl}
                    size="lg"
                    target="_blank"
                  >
                    길찾기
                  </Button>
                </Col>
              </Row>
            </Container>
          </div>
       );
  }
);


  return (
    <><>
      <ExamplesNavbar />
      <div className="page-header clear-filter">
        <div
          className="page-header-image"
          style={{
            backgroundImage: "url(" + require("assets/img/login1.jpg").default + ")",
          }}
        ></div>
      </div>



      </><div class="zone_wrap">
        <div class="list_zone">
          <div class="tit">
            <h2 id="zoneTitle">맛집여행</h2>
          </div>
          {Namelists}
        </div>
      </div>
      <DarkFooter /></>
  );
}

export default FoodPage;
